import React from 'react';
import logo from './assets/logo_transparent';
import './App.scss';
//import hero from './assets/hero-splash.jpg';

function App() {
  return (
    <div className="App">
      <div className="hero-section">
        <div className="logo-box">
        <img src={logo} className="logo-control" alt="Logo"></img>
        </div>
        <nav className="navbar">
          <NavItem link="#" title="Hidden"/>
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Products</a>
          <a href="#">Help</a>
        </nav>
        <HeroText text="THIS IS A HEADLINE."/>
        </div>
    </div>
  );
}

function NavItem(props){
  return <a href={props.link}>{props.title}</a>;
}

function HeroText(props){
  return <p className="hero-text">{props.text}</p>;
}

export default App;
